import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';
import { RouterModule } from '@angular/router';

import { AppComponent } from './app.component';
import { HeaderComponent } from './header/header.component';
import { MenuComponent } from './menu/menu.component';
import { CategoriesComponent } from './menu/categories/categories.component';
import { FoodListComponent } from './menu/food-list/food-list.component';
import { FoodItemComponent } from './menu/food-list/food-item/food-item.component';
import { BasketComponent } from './basket/basket.component';
import { SignInComponent } from './sign-in/sign-in.component';
import { RegisterComponent } from './register/register.component';
import { UserProfileComponent } from './user-profile/user-profile.component';
import { AdminProfileComponent } from './admin-profile/admin-profile.component';


@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    MenuComponent,
    CategoriesComponent,
    FoodListComponent,
    FoodItemComponent,
    BasketComponent,
    SignInComponent,
    RegisterComponent,
    UserProfileComponent,
    AdminProfileComponent
  ],
  imports: [
    BrowserModule.withServerTransition({ appId: 'ng-cli-universal' }),
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot([
      { path: '', component: MenuComponent, pathMatch: 'full' },
      { path: 'menu', component: MenuComponent },
      { path: 'buy-food/:foodId', component: BuyFoodComponent},

    ])
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
